  null,\n\t\"notes\": \"The river mileage established by the US Army Corps of Engineers
  St. Paul District is from Plates 2-13 from the Souris-Red-Rainy River Basins, Red
  River Type II Study, Red River Main Stem, Regional Floodplain Area.  The drawings
  are dated 1972.  These drawings cover the Red River from Emerson, Manitoba (Canada)
  to White Rock Dam on the north end of Mud Lake. Included in the Omaha District are
  the Missouri, Little Missouri, Yellowstone and James Rivers.\",\n\t\"license_title\":
